import React, { useState, useEffect } from 'react';
import {
  Box,
  TextField,
  Button,
  Grid,
  Paper,
  Typography,
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  MenuItem,
  Chip,
} from '@mui/material';
import axios from 'axios';

const positions = ['', 'PG', 'SG', 'SF', 'PF', 'C'];

const AdvancedPlayerSearch = () => {
  const [searchCriteria, setSearchCriteria] = useState({
    min_points: '',
    min_rebounds: '',
    min_assists: '',
    position: '',
  });
  const [results, setResults] = useState([]);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);
  const [apiDebugData, setApiDebugData] = useState(null);

  const handleChange = (event) => {
    const { name, value } = event.target;
    setSearchCriteria(prev => ({
      ...prev,
      [name]: value
    }));
  };

  const handleSearch = async () => {
    setLoading(true);
    setError(null);
    setApiDebugData(null);
    
    try {
      const params = new URLSearchParams();
      Object.entries(searchCriteria).forEach(([key, value]) => {
        if (value) {
          if (key === 'position') {
            const positionValue = value;
            params.append(key, positionValue);
            console.log('Searching for position:', positionValue);
          } else {
            params.append(key, value);
          }
        }
      });

      const url = `http://localhost:5000/api/players/search?${params}`;
      console.log('Making request to:', url);
      
      try {
        const response = await axios.get(url);
        console.log('Raw API Response:', response);
        console.log('API Response Data:', response.data);
        
        // Store the raw response data for debugging
        setApiDebugData(response.data);
        
        // Ensure we have an array of players
        const playerData = Array.isArray(response.data) ? response.data : [];
        console.log('Found players:', playerData.length);
        
        if (playerData.length === 0) {
          setError(`No players found for position ${searchCriteria.position}. Try adjusting your search.`);
          setResults([]);
        } else {
          setResults(playerData);
          console.log('Successfully set results with', playerData.length, 'players');
        }
      } catch (axiosError) {
        console.error('Axios error details:', {
          message: axiosError.message,
          status: axiosError.response?.status,
          statusText: axiosError.response?.statusText,
          responseData: axiosError.response?.data
        });
        setApiDebugData(axiosError.response?.data || axiosError.message);
        throw axiosError;
      }
    } catch (error) {
      console.error('Error searching players:', error);
      setError(`Failed to search players: ${error.message}`);
      setResults([]);
    } finally {
      setLoading(false);
    }
  };

  const renderTable = () => {
    if (!Array.isArray(results) || results.length === 0) return null;

    return (
      <>
        <Typography variant="subtitle1" gutterBottom>
          Showing {results.length} players sorted by points per game
        </Typography>
        <TableContainer component={Paper}>
          <Table>
            <TableHead>
              <TableRow>
                <TableCell>Rank</TableCell>
                <TableCell>Player</TableCell>
                <TableCell>Position</TableCell>
                <TableCell>Team</TableCell>
                <TableCell align="right">PPG</TableCell>
                <TableCell align="right">RPG</TableCell>
                <TableCell align="right">APG</TableCell>
                <TableCell align="right">FG%</TableCell>
                <TableCell align="right">3P%</TableCell>
                <TableCell align="right">GP</TableCell>
                <TableCell align="right">MPG</TableCell>
              </TableRow>
            </TableHead>
            <TableBody>
              {results.map((player, index) => (
                <TableRow 
                  key={`${player.name}-${player.team}-${index}`}
                  sx={{
                    backgroundColor: index < 3 ? 'rgba(144, 202, 249, 0.08)' : 'inherit',
                  }}
                >
                  <TableCell>
                    {index + 1}
                    {index < 3 && (
                      <Chip
                        size="small"
                        label={['ðŸ¥‡', 'ðŸ¥ˆ', 'ðŸ¥‰'][index]}
                        sx={{ ml: 1 }}
                      />
                    )}
                  </TableCell>
                  <TableCell>
                    <Typography variant="body2" fontWeight={index < 3 ? 'bold' : 'normal'}>
                      {player.name || 'N/A'}
                    </Typography>
                  </TableCell>
                  <TableCell>{player.position || 'N/A'}</TableCell>
                  <TableCell>{player.team || 'N/A'}</TableCell>
                  <TableCell align="right" sx={{ fontWeight: 'bold' }}>
                    {player.points ? player.points.toFixed(1) : 'N/A'}
                  </TableCell>
                  <TableCell align="right">{player.rebounds ? player.rebounds.toFixed(1) : 'N/A'}</TableCell>
                  <TableCell align="right">{player.assists ? player.assists.toFixed(1) : 'N/A'}</TableCell>
                  <TableCell align="right">{player.fieldGoalPercentage ? `${player.fieldGoalPercentage.toFixed(1)}%` : 'N/A'}</TableCell>
                  <TableCell align="right">{player.threePointPercentage ? `${player.threePointPercentage.toFixed(1)}%` : 'N/A'}</TableCell>
                  <TableCell align="right">{player.gamesPlayed || 'N/A'}</TableCell>
                  <TableCell align="right">{player.minutesPerGame ? player.minutesPerGame.toFixed(1) : 'N/A'}</TableCell>
                </TableRow>
              ))}
            </TableBody>
          </Table>
        </TableContainer>
      </>
    );
  };

  return (
    <Box>
      <Typography variant="h6" gutterBottom>
        Advanced Player Search
      </Typography>
      
      <Paper sx={{ p: 3, mb: 3 }}>
        <Grid container spacing={2}>
          <Grid item xs={12} sm={6} md={2.4}>
            <TextField
              fullWidth
              label="Min Points"
              name="min_points"
              type="number"
              value={searchCriteria.min_points}
              onChange={handleChange}
              inputProps={{ min: 0, step: 0.1 }}
            />
          </Grid>
          <Grid item xs={12} sm={6} md={2.4}>
            <TextField
              fullWidth
              label="Min Rebounds"
              name="min_rebounds"
              type="number"
              value={searchCriteria.min_rebounds}
              onChange={handleChange}
              inputProps={{ min: 0, step: 0.1 }}
            />
          </Grid>
          <Grid item xs={12} sm={6} md={2.4}>
            <TextField
              fullWidth
              label="Min Assists"
              name="min_assists"
              type="number"
              value={searchCriteria.min_assists}
              onChange={handleChange}
              inputProps={{ min: 0, step: 0.1 }}
            />
          </Grid>
          <Grid item xs={12} sm={6} md={2.4}>
            <TextField
              fullWidth
              select
              label="Position"
              name="position"
              value={searchCriteria.position}
              onChange={handleChange}
            >
              {positions.map((pos) => (
                <MenuItem key={pos} value={pos}>
                  {pos || 'Any Position'}
                </MenuItem>
              ))}
            </TextField>
          </Grid>
          <Grid item xs={12} sm={6} md={2.4}>
            <Button
              fullWidth
              variant="contained"
              onClick={handleSearch}
              disabled={loading}
              sx={{ height: '100%' }}
            >
              Search
            </Button>
          </Grid>
        </Grid>
      </Paper>

      {error && (
        <Typography color="error" sx={{ mb: 2 }}>
          {error}
        </Typography>
      )}

      {loading && (
        <Typography sx={{ mb: 2 }}>
          Loading...
        </Typography>
      )}

      {/* Debug section to show API response */}
      {apiDebugData && (
        <Paper sx={{ p: 2, mb: 2, backgroundColor: '#f5f5f5' }}>
          <Typography variant="subtitle2" gutterBottom>
            API Response Data:
          </Typography>
          <pre style={{ overflow: 'auto', maxHeight: '200px' }}>
            {JSON.stringify(apiDebugData, null, 2)}
          </pre>
        </Paper>
      )}

      {renderTable()}
    </Box>
  );
};

export default AdvancedPlayerSearch;
